import React, { useState } from "react"; // Импорт React и хуков, если нужно
function App() {
  const [open, setOpen] = React.useState(false);
  const toggleOpen = () => {
    setOpen(!open);
  };

  return (
    <div className="div">
      <button className="open" onClick={toggleOpen}>
        Open CODE
      </button>
      {open && <img className="img" src="https://i.gifer.com/EaH.gif"></img>}
    </div>
  );
}

export default App;
